   "source": [
    "##### title: \"World Happiness Report\"\n",
    "##### author: \"Carlos Moreno Hernández\"\n",
    "##### date: \"2024-01-05\"\n",
    "\n",
    "\n",
    "\n",
    "## <div style=\"text-align:center;\">¿Qué factores generales de la vida en mayor medida la felicidad mundial?\n",
    "</div>\n",
    "\n",
    "### Tarea empresarial\n",
    "<p style=\"text-align: justify;\">La tarea principal de la empresa ficticia AI solutions, es dar soluciones con inteligencia artificial aplicada a distintos campos de la sociedad considerando la relación que existe entre factores globales diversos desde el año 2015 al 2023 e identificando cuáles de los mismos impactan en mayor medida la felicidad de las personas.</p>\n",
    "\n",
    "### Fuentes de datos utilizadas\n",
    "<p style=\"text-align: justify;\">Los conjuntos de datos utilizados fueron obtenidos de la plataforma de <a href=\"https://www.kaggle.com/\">kaggle</a> a través de los siguientes links que contienen los archivos csv correspondientes a cada año.</p>\n",
    "\n",
    "\n",
    "- [World Happiness Report](https://www.kaggle.com/datasets/unsdsn/world-happiness) Notebook creado por SUSTAINABLE DEVELOPMENT SOLUTIONS NETWORK\n",
    "\n",
    "- [World Happiness Reports 2013-2023](https://www.kaggle.com/datasets/joebeachcapital/world-happiness-report-2013-2023?select=World+Happiness+Report+2023.csv) Notebook creado por JOAKIM ARVIDSSON\n",
    "\n",
    "<p style=\"text-align: justify;\">Del primer link se utilizaron los archivos de excel .csv de los años 2015 al 2019, y del segundo link desde el año 2020 al 2023 para la descarga de los conjuntos de datos necesarios para nuestro análisis. El conjunto de datos utilizado en este reporte lo elaboré seleccionando únicamente la información que consideré necesaria para mi análisis, y con este mismo fue con el que realicé mi visualización  <a href=\"https://public.tableau.com/views/WorldHappinessReportDashboard_17046518414310/HappinessScoreDB?:language=es-ES&publish=yes&:display_count=n&:origin=viz_share_link\">World Happiness Report Dashboard</a> que mencionaré posteriormente. </p> \n",
    "\n",
    "<p style=\"text-align: justify;\">Antes de comenzar a analizar las fuentes de datos usadas en este reporte, hay que considerar el término de residual de distopía o DystopiaResidual, que en este contexto de este conjunto de datos es un país teórico que tiene la gente menos feliz del mundo. Sirve como punto de referencia con el que se comparan todos los demás países, la idea es crear un punto de referencia para el puntaje de felicidad más bajo posible que podría tener un país, dadas ciertas condiciones como por ejemplos ingresos bajos, falta de apoyo social o baja esperanza de vida.</p>\n",
    "\n",
    "<p style=\"text-align: justify;\">Este campo se obtiene al restar del puntaje total de felicidad de cada país, los demás factores que contribuyen a la felicidad del mismo, lo que ayuda a estandarizar las puntuaciones de felicidad garantizando que la puntuación de felicidad más baja posible sea diferente de cero, creando así una escala donde una puntuación de 0 representa el nivel de felicidad de la distopía residual, y puntuaciones más altas indican niveles más altos de felicidad.</p>\n",
    "\n",
    "<p style=\"text-align: justify;\">Otro término que de igual manera considero se debe definir, es el de error estándar, que podemos decir que es una forma de medir la dispersión o variabilidad de un conjunto de datos estadísticos para estimar su precisión de estimación o qué tanto pueden variar los resultados de una muestra a otra.</p>\n",
    "\n",
    "<p style=\"text-align: justify;\">Una vez comprendidos los coneptos anteriores, a continuación se realiza una breve descripción de cada uno de los conjuntos de datos utilizados:</p>\n",
    "\n",
    "### Año 2015\n",
    "\n",
    "<p style=\"text-align: justify;\">En el primer caso del año 2015, se tienen los primeros tres registros de la tabla correspondiente a este año que cuenta con 12 columnas o campos, dentro de las cuáles podemos encontrar el país, el continente al que pertenece el mismo, su ranking y puntaje de felicidad, error estándar, familia, salud o esperanza de vida, corrupción, generosidad y el residual de distopía.</p>\n"
   ]
  },
