    "### Año 2016\n",
    "<p style=\"text-align: justify;\">Posteriormente en la tabla del año 2016 podemos ver algunas diferencias con las columnas de la tabla del año 2015, como dos campos nuevos de intervalo de confianza inferior (Lower Confidence Interval), y el intervalo de confianza superior (Upper Confidence Interval) en lugar del Error Estándar. El intervalo de confianza es una medida de la incertidumbre o precisión relacionada con una estimación puntual. Se puede decir que hay un 95% de confianza en que la verdadera felicidad promedio de las personas en cada país está entre ciertos límites inferiores o superiores, es si dijéramos que el puntaje de felicidad real está en ese rango, mientras menor sea éste, va a haber más confianza, y al ser mayor, menos confianza o una estimación menos precisa.</p>"
   ]
