   "source": [
    "<p style=\"text-align: justify;\">En los siguientes dos años posteriores que fueron el 2020 y el 2021, se retoma el error estándar del año 2015, la región de cada país, los extremos superiores e inferiores del gráfico de bigote del año 2017, e incluye el apoyo social al igual que en los años 2018 y 2019. Mientras que se elimina la columna de ranking en este periodo de tiempo.</p>\n",
    "\n",
    "<p style=\"text-align: justify;\">También cambia el nombre de algunas columnas como el Ladder Score que es el puntaje de felicidad de cada país, o la puntuación resultante de una evaluación donde se pide al encuestado clasificar su vida en una escala de 0 a 10, donde 0 representa la peor vida y 10 la mejor vida o la vida más feliz, así como este Ladder se tiene otro pero para el residual de distopía. Además de que cada uno de los factores que contribuye a la felicidad como por ejemplo la generosidad, tiene una columna asociada con el prefijo \"Explained by:\" que indica cuánto la generosidad o ese factor en específico contribuye a la felicidad general del país.</p>\n",
    "\n",
    "### Año 2020"
   ]
  },
