   "source": [
    "### Limpiezas y manipulaciones de datos\n",
    "<p style=\"text-align: justify;\">En este apartado, se pretende especificar las modificaciones que se hayan hecho a los conjuntos de datos que se utilizaron en el análisis. La primer tarea realizada fue verificar que no se tuvieran duplicados, lo cuál lo podemos realizar en Google Sheets con seleccionando la tabla, y luego en la pestaña de <strong>Data</strong>, las opciones de <strong>Data clean-up>Remove duplicates</strong>, donde los resultados obtenidos fueron que no había ningún registro duplicado. Lo segundo que realicé en cada una de las tablas fue la verificación de que no haya valores nulos en los campos con la función de Excel =COUNTBLANK(), aunque también se pudiera realizar con una sentencia de SQL que haga una comparación con NULL.</p>\n",
    "\n",
    "<p style=\"text-align: justify;\">Para poder realizar un mejor análisis, comparé cada uno de los campos entre los distintos años del reporte de felicidad, y consideré las siguientes tablas como las más importantes que todos los años tienen en común para poder compararlos y tener una pespectiva más grande de cómo o en qué medida ha influido cada factor en la felicidad global en el periodo de tiempo mencionado desde el año 2015 al 2023. Los campos que consideré para las nuevas tablas fueron . \n",
    "</p>\n",
    "\n",
    "<p style=\"text-align: justify;\">Otra manipulación de datos que se realizó fue la falta de estandarización de los nombres de las columnas de todos los años, ya que en bastantes casos se tenían nombres parecidos que varíaban un poco en su escritura pero se referían al mismo tipo de dato. A continuación enlistaré los cambios en los nombres que asigné a cada columna de las que se pretenden analizar en la siguiente etapa para todos los años desde el 2015 al 2023, mencionando una breve descripción de la misma y luego cómo es que estaban escritos antes de mi modificarse en dado caso de que haya sido necesario (si en cierto campo no aparece el año enlistado, es porque ya estaba escrito de la manera en que lo estandaricé): </p>\n",
    "\n",
    "- **Ranking:** es la posición del país más feliz del mundo al menos feliz dependiendo su puntaje o Score.\n",
    "<p style=\"text-align: justify; margin-left: 20px;\"><em>wordlhappiness_2015:</em> Happiness Rank</p>\n",
    "<p style=\"text-align: justify; margin-left: 20px;\"><em>wordlhappiness_2016:</em> Happiness Rank</p>\n",
    "<p style=\"text-align: justify; margin-left: 20px;\"><em>wordlhappiness_2017:</em> Happiness.Rank</p>\n",
    "<p style=\"text-align: justify; margin-left: 20px;\"><em>wordlhappiness_2018:</em> Overall rank</p>\n",
    "<p style=\"text-align: justify; margin-left: 20px;\"><em>wordlhappiness_2019:</em> Overall rank</p>\n",
    "<p style=\"text-align: justify; margin-left: 20px;\"><em>wordlhappiness_2020:</em> No existente (se creó basándonse en el Score de cada país, ordenando estos valores de mayor a menor)</p>\n",
    "<p style=\"text-align: justify; margin-left: 20px;\"><em>wordlhappiness_2021:</em> No existente (se creó basándonse en el Score de cada país, ordenando estos valores de mayor a menor)</p>\n",
    "<p style=\"text-align: justify; margin-left: 20px;\"><em>wordlhappiness_2022:</em> RANK</p>\n",
    "<p style=\"text-align: justify; margin-left: 20px;\"><em>wordlhappiness_2023:</em> No existente (se creó basándose en el Score de cada país)</p>\n",
    "\n",
    "- **Country:** nombre del país al cuál se le hizo el estudio de factores que influyen en la felicidad de las personas.\n",
