    "<p style=\"text-align: justify; margin-left: 20px;\"><em>wordlhappiness_2018:</em> Freedom to make life choices</p>\n",
    "<p style=\"text-align: justify; margin-left: 20px;\"><em>wordlhappiness_2019:</em> Freedom to make life choices</p>\n",
    "<p style=\"text-align: justify; margin-left: 20px;\"><em>wordlhappiness_2020:</em> Explained by: Freedom to make life choices</p>\n",
    "<p style=\"text-align: justify; margin-left: 20px;\"><em>wordlhappiness_2021:</em> Freedom to make life choices</p>\n",
