    "\n",
    "- **Generosity:** es una medida de la generosidad de las personas en todo el mundo en total en cada uno de los años.\n",
    "<p style=\"text-align: justify; margin-left: 20px;\"><em>wordlhappiness_2020:</em> Explained by: Generosity</p>\n",
