    "\n",
    "- **DystopiaResidual**: se obtiene al restar al porcentaje total de felicidad o el factor Score mencionado antes, el resto de factores que influyen en la felicidad, y equivale a ese porcentaje no explicado de un país en relación con los demás factores o características no tan tradicionales como las consideradas.\n",
