    "\n",
    "<p style=\"text-align: justify; margin-left: 20px;\">En general de todos los años a analizar, las columnas o campos de WhiskerHigh, WhiskerLow, StandardError, LowerConfidenceInterval, y UpperConfidenceInterval no se modificaron ni se estandarizaron sus nombres ya que no formarán parte del análisis a realizar.</p>\n",
    "\n",
    "<p style=\"text-align: justify; margin-left: 20px;\">Algunas de las limpiezas de datos que se hicieron fueron las siguientes:</p>\n",
    "\n",
    "- Se redujeron los decimales de todos los datos numéricos a tres dígitos para una mejor visualización y limpieza visual.\n",
    "\n",
    "- En el año 2018, en la columna de \"Perceptions of corruption\" del país \"United Arab Emirates\" se tenía la cadena de texto \"N/A\", la cuál fue reemplazada por un 0.\n",
    "\n",
    "- En el país de \"Palestine\", del año 2023, se tenía originalmente NULL o ningún valor en la columna de \"Explained by: Healthy life expectancy\", por lo que agregué el valor de 0.\n",
    "\n",
    "- De la tabla del año 2022, en los siguientes países se les eliminó el símbolo de * que tenían al final de la cadena de texto del país, usando un filtro para determinar cuáles eran los nombres de países que terminaban con ese caracter: Luxembourg\\*,Guatemala\\*,Kuwait\\*,Belarus\\*,Turkmenistan\\*,North Cyprus\\*,Libya\\*,Azerbaijan\\*,Gambia\\*,Liberia\\*,Niger\\*,Comoros\\*,Palestinian Territories\\*,Eswatini, Kingdom of\\*,Madagascar\\*,Chad\\*,Yemen\\*,Mauritania\\*,Lesotho\\*,Botswana\\*,Rwanda\\*.\n",
    "\n",
    "<p style=\"text-align: justify; margin-left: 20px;\">Por último de este apartado, mostraré las primeras 3 filas o registros de otro archivo de excel que creé que contiene toda la información de los factores anteriores que influyen en la felicidad (Ranking, Country, Score, Economy, Family, LifeExpectancy, Freedom, NoCorruption, Generosity, y DystopiaResidual). En este archivo llamado BDT (Base de Datos Total) que creé, agregué una hoja con el mismo nombre de BDT que tiene todos los datos limpiados, además de agregar una hoja adicional para cada año reporte del World Happiness Report para así poder ir comparando la información más fácilmente.</p>\n",
    "\n",
    "<p style=\"text-align: justify; margin-left: 20px;\">En la hoja de BDT, agregué otras tres columnas las cuáles fueron: </p>\n",
    "\n",
    "<p style=\"text-align: justify; margin-left: 20px;\">- <strong>No:</strong> sirve para llevar un registro del total de países que han sido considerados para el reporte de World Happiness Report.</p>\n",
    "\n",
    "<p style=\"text-align: justify; margin-left: 20px;\">- <strong>IdYearCountry:</strong> es la primarykey que nos ayuda a que verifiquemos que no se repitan los datos.</p>\n",
    "\n",
    "<p style=\"text-align: justify; margin-left: 20px;\">- <strong>IfDuplicates:</strong> nos ayuda a que usemos el IdAñoPais con la función =SI(B3=B2,1,0), para que en dado caso que un IdAñoPais sea igual al nos ponga un 1, o en caso contrario un 0.</p>\n",
    "\n",
    "<p style=\"text-align: justify; margin-left: 20px;\">- <strong>Year:</strong> es necesaria para saber qué registro corresponde a cada año en la tabla BDT, y nos ayuda a crear el IdAñoPais.</p>"
   ]
  },
