   "source": [
    "### Análisis\n",
    "\n",
    "</p>En esta sección definiré el análisis realizado por mi parte con respecto a los datos obtenidos de las fuentes de datos mencionadas en los apartados anteriores. Como primer punto se puede decir que cada uno de los conjuntos de datos de cada año, tienen columnas con nombres iguales o parecidos en la mayoría de los casos, pero también algunos otros como en el caso de \"Social Support\" desde 2018 a 2023, al analizar los datos pude deducir que eran equivalentes a la columna de \"Family\" del 2015 al 2017.</p>\n",
    "\n",
    "<p style=\"text-align: justify;\">Otro aspecto a considerar es el hecho de que en la tabla del año 2022, todos los factores que influyen en la felicidad tienen como prefijo en el nombre de sus respectivas columnas el prefijo \"Explained by\" que se refiere según el World Happiness Report a cuánto cada uno de esos factores contribuye a la felicidad general del país, lo que se repite también en algunos otros casos de otros años como el 2023 pero en ese caso hay por ejemplo, una columna para generosidad (Generosity), y otra con el prefijo llamada \"Explained by Generosity\", en estos casos comparé los datos y utilicé las tablas mencionadas en el apartado anterior para que los datos tuvieran más sentido ya que en muchos casos, se elevaban mucho los valores como en el caso de la esperanza de vida (Health life expectancy) del año 2023, y por esa razón decidí utilizar la columna que contaba con el prefijo \"Explained by\" debido a que los datos estaban más relacionados con el resto de los años.</p>\n",
    "\n",
    "<p style=\"text-align: justify;\">De igual manera en el caso de mi Base de Datos Total (BDT) la columna de IdyearCountry pudiera haber sido no tan necesaria porque para eso existe la funcionalidad de remover duplicados, sin embargo, la realicé para que se considere como una primary key en dado caso de que en un futuro se llegara a relacionar con otra tabla relacionada con otro tipo de temas. </p> \n",
    "\n",
    "### Visualizaciones y hallazgos clave\n",
    "\n",
    "En este apartado, mostraré las gráficas principales que fueron analizadas y creadas para el análisis realizado previamente. \n",
    "\n",
    "#### Puntaje total de felicidad (2015-2023)\n",
    "<p style=\"text-align: justify;\">En esta primera visualización, podemos ver el puntaje total del rubro de felicidad en el mundo englobando el total de puntos obtenidos en este rubro específico en e cada uno de los años desde el 2015 al 2023. De este gráfico particular podemos mencionar que la línea nos indica que el valor más alto o donde se tuvo el porcentaje más grande de felicidad fue en el año 2015, y a partir de ahí se fueron dando altibajos hasta el 2019, y en el año 2020, que fue justo a inicios del mismo que comenzó la pandemia de COVID-19, el valor total de felicidad en el mundo bajó considerablemente y aún más en el año 2022.</p>"
   ]
  },
