   "source": [
    "<p style=\"text-align: justify;\">A partir de el siguiente gráfico de líneas mostrado a continuación, se pueden visualizar las distintas relaciones que existen entre el puntaje total de cada uno de los factores que influyen o afectan en la felicidad   que son la generosidad, familia, libertad, GDP per capita, esperanza de vida, y no corrupción de todos los países incluidos en los conjuntos obtenidos de las fuentes de datos, y el año al que pertenecen esos valores desde el 2015 al 2023, la visualización de estos gráficos nos permitirán en la sección de conclusiones relacionar los resultados obtenidos, y responder la pregunta principal que corresponde a la tarea empresarial de la empresa que es ver qué factores son los que influyen más en la felicidad total para poder desarrollar soluciones con inteligencia artificial. </p>\n",
    "\n",
    "#### Puntaje total de generosidad (2015-2023)"
   ]
