   "source": [
    "library(openxlsx)\n",
    "file_path <- file.path(\"/kaggle/input/world-happiness-report-2015-2023\", \"GraphsR.xlsx\")\n",
    "object_BDT <- read.xlsx(file_path)\n",
    "library(ggplot2)\n",
    "generosity_happiness_score <- ggplot(data = object_BDT) +\n",
    "  geom_line(mapping = aes(x = Year, y = Generosity), color = \"orange\") +\n",
    "  labs(\n",
    "    title = \"Generosidad total por año (2015-2023)\",\n",
    "    x = \"Año\",\n",
    "    y = \"Generosidad\"\n",
    "  ) +\n",
    "  theme(\n",
    "    plot.title = element_text(hjust = 0.5)  # hjust = 0.5 centra el título\n",
    "  )\n",
    "\n",
    "generosity_happiness_score"
   ]
