   "source": [
    "library(openxlsx)\n",
    "file_path <- file.path(\"/kaggle/input/world-happiness-report-2015-2023\", \"GraphsR.xlsx\")\n",
    "object_BDT <- read.xlsx(file_path)\n",
    "library(ggplot2)\n",
    "family_score <- ggplot(data = object_BDT) +\n",
    "  geom_line(mapping = aes(x = Year, y = LifeExpectancy), color = \"#9F1204\") +\n",
    "  labs(\n",
    "    title = \"Familia total por año (2015-2023)\",\n",
    "    x = \"Año\",\n",
    "    y = \"Familia\"\n",
    "  ) +\n",
    "  theme(\n",
    "    plot.title = element_text(hjust = 0.5)\n",
    "  )\n",
    "\n",
    "family_score"
   ]
