   "source": [
    "library(openxlsx)\n",
    "file_path <- file.path(\"/kaggle/input/world-happiness-report-2015-2023\", \"GraphsR.xlsx\")\n",
    "object_BDT <- read.xlsx(file_path)\n",
    "library(ggplot2)\n",
    "freedom_happiness_score <- ggplot(data = object_BDT) +\n",
    "  geom_line(mapping = aes(x = Year, y = Freedom), color = \"#0098E0\") +\n",
    "  labs(\n",
    "    title = \"Libertad total por año (2015-2023)\",\n",
    "    x = \"Año\",\n",
    "    y = \"Libertad\"\n",
    "  ) +\n",
    "  theme(\n",
    "    plot.title = element_text(hjust = 0.5)  # hjust = 0.5 centra el título\n",
    "  )\n",
    "\n",
    "freedom_happiness_score"
   ]
  },
