   "source": [
    "library(openxlsx)\n",
    "file_path <- file.path(\"/kaggle/input/world-happiness-report-2015-2023\", \"GraphsR.xlsx\")\n",
    "object_BDT <- read.xlsx(file_path)\n",
    "library(ggplot2)\n",
    "gdp_happiness_score <- ggplot(data = object_BDT) +\n",
    "  geom_line(mapping = aes(x = Year, y = GDP), color = \"#9AEA00\") +\n",
    "  labs(\n",
    "    title = \"GDP per capita total por año (2015-2023)\",\n",
    "    x = \"Año\",\n",
    "    y = \"GDP per capita\"\n",
    "  ) +\n",
    "  theme(\n",
    "    plot.title = element_text(hjust = 0.5)  # hjust = 0.5 centra el título\n",
    "  )\n",
    "\n",
    "gdp_happiness_score"
   ]
