   "source": [
    "library(openxlsx)\n",
    "file_path <- file.path(\"/kaggle/input/world-happiness-report-2015-2023\", \"GraphsR.xlsx\")\n",
    "object_BDT <- read.xlsx(file_path)\n",
    "library(ggplot2)\n",
    "\n",
    "life_expectancy_score <- ggplot(data = object_BDT) +\n",
    "  geom_line(mapping = aes(x = Year, y = LifeExpectancy), color = \"#9400E1\") +\n",
