    "### Entregables para exploración posterior\n",
    "<p style=\"text-align: justify;\">Algunos entregables que se podrían realizar en un futuro posterior, serían:</p>\n",
    "\n",
    " - <p style=\"text-align: justify;\">Un aspecto que creo es importante es el hecho de que la cantidad total de países que participaron en el reporte de World Happiness Report no es constante, ya que abarca rangos distintos desde los <strong>138</strong> hasta <strong>159</strong> países distintos incluidos en las muestras de cada año, pero en este sentido, nosotros como analistas de datos no podemos agregar o eliminar ningún país a nuestra consideración, para que se evite algún tipo de sesgo en un futuro.</p>\n",
    " \n",
    "<p style=\"text-align: justify; margin-left: 40px;\">Sin embargo, podríamos crear una nueva tabla donde se haga una consulta en SQL o con fórmulas en Google Sheets donde se compare cada año con los demás restantes que se consideraron para el análisis, para ver cuáles son los años que tienen países o registros que no fueron incluidos en algunos otros años, ya que a mi parecer esto podría considerarse un sesgo al no tomar en cuenta a la misma cantidad de países todos los años que pudieran contribuir a la felicidad global.</p>\n",
    "\n",
    " - <p style=\"text-align: justify;\">Debido a los hallazgos clave que fueron encontrados en las visualizaciones de este reporte, una posible entrega adicional que sería útil para explorarse posteriormente es relacionar el conjunto de datos de mi Base de Datos Total, con alguna otra base de datos relacionada con el COVID, o algunas otras pandemias a lo largo de la historia, y ver ahora la relación que tienen con cada uno de los factores que influyen en la felicidad, o en el puntaje total de felicidad de las personas alrededor del mundo.</p>\n",
    " \n",
    "- <p style=\"text-align: justify;\">Análisis particulares con las visualizaciones dinámicas generadas en Tableau por cada característica que afecta al puntaje total de felicidad, y los países con porcentajes más elevados y bajos de la característica correspondiente, con la finalidad de buscar en internet si coinciden los resultados que vemos visualmente en el gráfico con los datos arrojados por la web.</p>\n"
   ]
  },
