    "### Conclusiones\n",
    "<p style=\"text-align: justify;\">Por último, en este apartado daré mis conclusiones de manera resumida sobre este reporte, comenzando con lo más importante a mi parecer que es la respuesta a la pregunta relacionada con la tarea empresarial que es los factores de vida que influyen en mayor medida en la felicidad de las personas alrededor del mundo para así poder desarrollar aplicaciones de inteligencia artificial que brinden soluciones dirigidas principalmente a los países donde estos factores no estén muy bien desarrollados.</p>\n",
    "\n",
    "<p style=\"text-align: justify;\">\n",
    "Empezando por lo que encontré en los datos relacionado con cada uno de los factores que influyen en el punte total de felicidad, con las gráficas mostradas en este reporte podemos deducir que hay una fuerte relación entre la esperanza de vida y la felicidad de las personas, ya que en los años 2015 y 2019 que fueron de los años con más esperanza de vida, también coinciden esos mismos años con los años donde los porcentajes de felicidad fueron elevados, lo mismo interpreté aunque no con la misma certeza de la relación entre la generosidad y la felicidad de las personas, debido a que sí coincidieron los patrones de comportamiento, pero del año 2017 al 2018 la generosidad en el mundo bajó, mientras que el porcentaje de felicidad subió.\n",
    "</p>\n",
    "\n",
    "<p style=\"text-align: justify;\">\n",
    "Ahora siguiendo con los factores que menos influyeron en la felicidad fueron el ingreso per capita de las personas, ya que éste del año 2020 al 2022 creció en lugar de disminuirse al contrario que en los puntajes totales de felicidad, lo mismo que ocurrió de manera similar enel factor de la libertad. En el resto de los demás factores sí fueron más variables los resultados, sin embargo, hubo algunos cambios muy abruptos en el factor de no corrupción del año 2019 al 2020, luego del 2020 al 2021 se mantuvo estable, y del 2021 al 2022 volvió a disminuir demasiado, por lo que podría ser favorable consultar otros conjuntos de datos relacionados con esta característica y comparase para ver las diferencias o similitudes.\n",
    "</p>\n",
    "\n",
    "<p style=\"text-align: justify;\">\n",
    "Como mencioné en el último párrafo del apartado de visualizaciones y hallazgos clave, en el panel que realicé del World Happiness Report Dashboard, ahí me pude dar cuenta más fácilmente de detalles más específicos al poder visualizar cada país, y su color correspondiente a una escala del factor influyente en la felicidad, y su ranking de felicidad en el mismo año. Por poner algunos ejemplos, nos podemos dar cuenta que en el factor de generosidad los primeros cinco países en el ranking de felicidad, tienen un porcentaje alto de generosidad, siendo Suiza el país más feliz en el año 2015, con un puntaje de generosidad de 0.296 y felicidad de 7.587, luego sigue en segundo lugar Islandia con 0.436, y 7.561, en tercero Dinamarca con 0.341 y 7.527, cuarto lugar Noruega con 0.347 y 7.522, y finalmente  Canadá con 0.458 y 7.427 respectivamente (considerando que la escala de generosidad va de 0.2968 el menor valor y 0.4584 el mayor).\n",
    "</p>\n",
    "\n",
    "<p style=\"text-align: justify;\">Otro dato interesante del que me percaté al estar explorando la visualización de la confianza en la no corrupción, y es la razón por la que considero muy importante consultar otras fuentes de datos para entregables posteriores quizá un poco mejor documentadas, porque al inicio yo interpreté que mientras más alto el valor de la escala de confianza en la no corrupción, mayor confiaban las personas en que su país no es corrupto, sin embargo si observamos de manera general este mapa, nos podemos dar cuenta que es todo lo contrario ya que varios países primer mundistas y de los más felices del mundo, tienen porcentajes muy bajos en esta confianza en la no corrupción, es por esto que al final deduje que la escala está invertida en este caso, y mientras menor sea el valor, mayor es la confianza que se tiene en la no corrupción del país, lo cuál podría repetirse en todos los demás factores o características que se tomaron a consideración.\n",
    "</p>\n",
    "\n",
    "<p style=\"text-align: justify;\">Como conclusión final, podría decirse que en los factores de la vida cotidiana de las personas en que se deberían invertir más, para elevar los porcentajes totales de felicidad alrededor del mundo, serían en la generosidad, la familia, la esperanza de vida, y la relación con la familia; por lo que mi recomendación principal sería desarrollar aplicaciones con inteligencia artificial para atender ahora otras necesidades básicas más particulares, pero relacionadas o que afecten a cada uno de estos factores como por ejemplo algún asistente personal que lleve un registro de aspectos como el estado de ánimo, salud física y emocional, inculcación de valores, entre otros.\n",
    "</p>"
   ]
